DROP TABLE IF EXISTS `rencana_kebutuhan`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `rencana_kebutuhan` (
  `id_renbut` int(11) NOT NULL AUTO_INCREMENT,
  `kode` varchar(15) NOT NULL,
  `kode_cashbon` varchar(15) NOT NULL,
  `tanggal` date NOT NULL,
  `tanggal_kegiatan` date DEFAULT NULL,
  `tanggal_renbut` date DEFAULT NULL,
  `id_uraian` int(11) DEFAULT NULL,
  `keterangan` text NOT NULL,
  `jml_renbut` double NOT NULL,
  `cashbon` double NOT NULL,
  `nominal` double NOT NULL,
  `jml_dropping` double NOT NULL,
  `penerima` varchar(100) NOT NULL,
  `verificator` int(11) DEFAULT NULL,
  `status` enum('Rencana','Disetujui','Ditolak') NOT NULL,
  `date_verify` date DEFAULT NULL,
  `tanggal_cair` date DEFAULT NULL,
  `id_akun_rekening` int(11) DEFAULT NULL,
  PRIMARY KEY (`id_renbut`),
  KEY `id_uraian` (`id_uraian`),
  KEY `verificator` (`verificator`),
  KEY `id_akun_rekening` (`id_akun_rekening`),
  CONSTRAINT `rencana_kebutuhan_ibfk_1` FOREIGN KEY (`id_uraian`) REFERENCES `uraian` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `rencana_kebutuhan_ibfk_3` FOREIGN KEY (`verificator`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `rencana_kebutuhan_ibfk_4` FOREIGN KEY (`id_akun_rekening`) REFERENCES `rekening` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3113 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

